import React from 'react'

const Box = (props) => {
  return (
    <>
      <h1>{props.text}</h1>
      <h2>{props.text}</h2>
    </>
  )
}

const App = () => {
  return(
    <Box
     text="Hi, Boris"
     subtitle="I love React!"
     />
  )
}

export default App;
